import React from 'react';

const AuthForm = () => {
    return (
        <div>
            <h2>Login</h2>
            <form>
                <div>
                    <input type="text" placeholder={'Username'} />
                </div>
                <div>
                    <input type="password" placeholder={'Password'} />
                </div>
                <div>
                    <button>Login</button>
                </div>
            </form>
        </div>
    );
};

export default AuthForm
